function Start(idActorResurrected, idActorSource)

	if (Hydra.KeyedDungeonGetRemainingRevives() == 0) then
		Hydra.QuestCallbackCountSet(54, 1);
	end

	--[[
	-- When self-resurrecting, the source is ACDID_INVALID
	if (Hydra.ActorIsValid(idActorSource) == false) then
		nResurrectionCount = nResurrectionCount + 1;
		
		if (nResurrectionCount >= nResurrectLimit) then
			-- Trigger the next phase of the quest
			Hydra.QuestCallbackCountSet(54, 1);
		end
	end
	]]--

end

function Start(idActorKiller, idActorKilled)

	if (Hydra.CanKeyedDungeonContinueAfterPlayerDeath(idActorKilled)) then
		return;
	end
	
	-- Trigger next phase if everybody is dead
	Hydra.QuestCallbackCountSet(52, 1);
end
